353","dur":"169","text":"354"},{"start":"355","dur":"356","text":"357"},{"start":"358","dur":"201","text":"359"},{"start":"360","dur":"142","text":"361"},{"start":"362","dur":"363","text":"364"},{"start":"365","dur":"366","text":"367"},{"start":"368","dur":"369","text":"370"},{"start":"371","dur":"372","text":"373"},{"start":"374","dur":"269","text":"375"},{"start":"376","dur":"195","text":"377"},{"start":"378","dur":"169","text":"379"},{"start":"380","dur":"163","text":"381"},{"start":"382","dur":"180","text":"383"},{"start":"384","dur":"266","text":"385"},{"start":"386","dur":"387","text":"388"},{"start":"389","dur":"390","text":"391"},{"start":"392","dur":"305","text":"393"},{"start":"394","dur":"395","text":"396"},{"start":"397","dur":"398","text":"399"},"0.320","2.160","Apache spark an open- Source data","2.480","1.920","analytics engine that can process","4.400","1.919","massive streams of data from multiple","6.319","1.881","sources like an octopus juggling","8.200","2.960","chainsaws it was created in 2009 by mate","11.160","2.760","zaharia at UC Berkeley's amp lab around","13.920","1.639","this time the amount of data being","15.559","1.841","collected on the internet was exploding","17.400","2.039","from megabytes to pedabytes making it","19.439","1.721","impossible to analyze on a single","21.160","1.640","machine but there was already a clever","22.800","1.960","programming model called map reduce you","24.760","map data into key value pairs Shuffle","26.920","2.040","and sort them into groups by key then","28.960","1.840","reduce each group to to compute a final","30.800","1.958","result this allowed large data sets to","32.759","2.281","be distributed across multiple machines","35.040","1.480","but there was still a huge bottleneck","36.520","2.640","caused by dis iio aache spark fixed this","39.160","1.800","by doing most of its work in memory","40.960","1.599","instead of reading from disk which can","42.559","2.000","be up to 100 times faster and that's a","44.559","2.041","game Cher for big data analytics and","46.600","2.080","machine learning it's used by Amazon to","48.680","2.440","analyze e-commerce data by NASA's jet","51.120","2.279","propulsion lab to analyze deep space","53.399","along with 80% of Fortune 500 companies","55.680","to process all their data despite its","57.600","reputation for distributed big data","59.519","processing you can easily run Apache","61.519","1.761","spark locally on your own machine it's","63.280","2.360","written in Java and runs on the jvm but","65.640","its apis can be used with wrappers for","67.720","2.600","python SQL and many other languages to","70.320","1.839","get started install it then let's","72.159","2.081","imagine we have a CSV file with four","74.240","2.840","columns for City population latitude and","77.080","1.880","longitude and our boss wants us to find","78.960","1.560","the city with the biggest population","80.520","between the tropics the first step is to","82.600","1.760","initialize a session and then load the","84.360","1.759","data into memory the spark will take the","86.119","spreadsheet and create a data frame","88.119","1.801","which turns the columns and rows into a","89.920","1.559","collection of objects they can be","91.479","2.121","processed across distributed nodes from","93.600","1.680","here we can apply transformations to the","95.280","2.400","data frame by chaining method calls like","97.680","1.799","in this case we want to filter the data","99.479","frame to exclude cities outside of the","101.479","tropics that transformation will happen","103.439","in memory then we can order the results","105.399","2.481","by population and finally use first to","107.880","grab the largest tropical City to the","109.719","city of Mexico City pretty cool and if","112.079","you're working with a SQL database you","113.920","can easily use that data directly","115.680","instead of the data frame API and when","117.680","2.200","working with massive data sets it Sparks","119.880","2.120","cluster manager or tools like kubernetes","122.000","can scale this workload horizontally","123.840","1.879","across an unlimited number of machines","125.719","1.481","but when it comes to machine learning","127.200","spark also has a secret weapon called","129.239","2.201","MLB let's build a predictive model by","131.440","first bringing in Vector assembler to","133.200","merge multiple columns into a vector","134.959","column then we can split it up into","136.760","training and testing data frames from","138.760","1.720","there spark has a wide variety of","140.480","1.479","different algorithms to handle","141.959","2.560","classification regression clustering and","144.519","so on all of which can be trained in a","146.360","distributed system congratulations you","148.400","can now train large scale Ma machine","150.080","learning models this has been a patchy","151.720","2.519","spark in 100 seconds but before one can","154.239","truly harness the full potential of","155.720","spark one must have a solid foundation","157.720","and math and problem solving and you can","159.440","start building that foundation for free","161.280","right now thanks to this video sponsor","163.280","brilliant brilliant's platform will","164.920","1.679","introduce you to essential programming","166.599","Concepts but most importantly the","168.599","Hands-On exercises will develop your","170.519","2.561","brain to recognize and solve complex","173.080","1.519","problems that developers need to","174.599","2.280","overcome on a daily basis best of all","176.879","1.921","every lesson is concise and rewarding","178.800","but by investing just a few minutes each","180.480","day you'll develop habits that can level","182.280","up your programming skills for the rest","183.920","of your life and you can do it anywhere","185.959","even from your phone to try everything","187.799","brilliant has to offer for free for 30","189.920","2.959","days visit brilliant.org fireship or","192.879","2.401","scan this QR code for 20% off their","195.280","premium annual subscription thanks for","197.159","1.601","watching and I will see you in the next","198.760","2.399","one"]
