, tds_html, flags=re.S|re.I)\\n    if len(tds_raw) < 5:\\n        continue\\n    tds = [clean(x) for x in tds_raw]\\n\\n    # 0:泥댄겕諛뺤뒪, 1:?대쫫, 2:?곗빱 ??鍮꾧탳??怨좎젙\\n    name = tds[1] if len(tds) > 1 else None\\n    ticker = tds[2] if len(tds) > 2 else None\\n\\n    # 鍮꾩쨷(%): ?쇰컲?곸쑝濡?3踰덉㎏ td???꾩튂?섎ŉ 諛섎뱶??% ?ы븿\\n    # (?뱀떆 ?꾩튂 諛붾뚮㈃ 泥?% ?ы븿 ??ぉ ?ъ슜)\\n    weight_idx = 3 if len(tds) > 3 and \\"%\\" in tds[3] else next((k for k,x in enumerate(tds) if \\"%\\" in x), None)\\n    if weight_idx is None:\\n        continue\\n    weight_pct = fnum(tds[weight_idx])\\n\\n    # --- ?섎㉧吏 移쇰읆? ?⑦꽩 湲곕컲?쇰줈 ?먯깋 ---\\n    after = tds[weight_idx+1:]  # 鍮꾩쨷 ?ㅼそ留??ㅼ틪\\n\\n    # 媛寃? % 湲고샇媛 '?녾퀬' ?レ옄媛 ?덈뒗 泥???ぉ\\n    price = None\\n    for x in after:\\n        if \\"%\\" not in x:\\n            v = fnum(x)\\n            if v is not None:\\n                price = v\\n                break\\n\\n    # 蹂??: % 湲고샇媛 '?덇퀬' ?レ옄媛 ?덈뒗 泥???ぉ\\n    change_pct = None\\n    for x in after:\\n        if \\"%\\" in x:\\n            v = fnum(x)\\n            if v is not None:\\n                change_pct = -abs(v) if x.strip().startswith(\\"-\\") else abs(v)\\n                break\\n\\n    if name and ticker and weight_pct is not None:\\n        holdings.append({\\n            \\"rank\\": i,\\n            \\"name\\": name,\\n            \\"ticker\\": ticker,\\n            \\"weight\\": weight_pct / 100.0,   # ?뚯닔\\n            \\"price\\": price,                 # float or None\\n            \\"change_pct\\": change_pct        # float(%) or None\\n        })\\n\\n# 媛以묒튂 ?뺢퇋???곸쐞 n ??= 1)\\ntotal = sum(h[\\"weight\\"] for h in holdings) or 1.0\\nfor h in holdings:\\n    h[\\"weight\\"] = round(h[\\"weight\\"] / total, 6)\\ntotal_norm = round(sum(h[\\"weight\\"] for h in holdings), 6)\\n\\nreturn [{\\"json\\": {\\"count\\": len(holdings), \\"totalWeight\\": total_norm, \\"holdings\\": holdings}}]\\n"},"type":"n8n-nodes-base.code","typeVersion":2,"position":[624,0],"id":"a55fa1a8-1fdb-4ff7-bb52-5c3f