o-generated-fromAI-override*/ $fromAI('URL', ``, 'string') }}","options":{}},"type":"n8n-nodes-base.httpRequestTool","typeVersion":4.2,"position":[-560,-256],"id":"d52b80fb-f4ef-4ec2-a9a0-a1c03498a2a5","name":"FetchPage"},{"parameters":{"toolDescription":"=Purpose\\n二??뚯뒪 ?ㅽ뙣 ???숈씪 URL(?뱀? ?泥?URL) ?ъ떆?꾪븯??HTML??媛?몄삩??\\n\\nInput (JSON)\\n\\n{\\n  \\"url\\": \\"https://kr.investing.com/etfs/498270-seoul-holdings\\",\\n  \\"headers\\": {\\n    \\"User-Agent\\": \\"Mozilla/5.0\\",\\n    \\"Cache-Control\\": \\"no-cache\\"\\n  }\\n}\\n\\n\\nHTTP settings\\n\\nMethod: GET\\n\\nFollow redirect: true\\n\\nTimeout: 15000 ms\\n\\nOutput (JSON)\\n\\n{ \\"status\\": 200, \\"html\\": \\"<!doctype html>...\\" }\\n\\n\\nSuccess criteria\\n\\nstatus ??{200, 304} AND html 湲몄씠 > 10,000\\n\\nFailure handling\\n\\n?ㅽ뙣 ???먯씠?꾪듃??以묐떒?섍퀬 ?먮윭 由ы룷???쒗럹?댁? ?섏쭛 ?ㅽ뙣??瑜?諛섑솚\\n\\nExample tool call\\n\\n{ \\"url\\": \\"https://kr.investing.com/etfs/498270-seoul-holdings\\" }","url":"={{ /*n8n-auto-generated-fromAI-override*/ $fromAI('URL', ``, 'string') }}","options":{}},"type":"n8n-nodes-base.httpRequestTool","typeVersion":4.2,"position":[-416,-256],"id":"c5815ffa-7cee-4502-afdc-a1968b76656f","name":"FallbackFetch"},{"parameters":{"options":{}},"type":"@n8n/n8n-nodes-langchain.chatTrigger","typeVersion":1.3,"position":[-1264,-480],"id":"95b1c203-2f70-4657-b29f-8b35ca52e68c","name":"When chat message received","webhookId":"4522938c-ca7c-44c4-8353-785c14255834"},{"parameters":{"description":"ETF 蹂댁쑀醫낅ぉ HTML ?뚯씠釉붿뿉??<tr> ?⑥쐞 ?됰뱾??異붿텧?섏뿬 rows 諛곗뿴???앹꽦?쒕떎.\\nrows媛 鍮꾩뼱?덇굅??min_rows 誘몃쭔?대㈃ Agent媛 FallbackFetch瑜??몄텧?댁빞 ?쒕떎.","language":"python","pythonCode":"# n8n Code node (Python) ??Run once\\n# Input  : items[0][\\"json\\"] = { \\"html\\": \\"<!doctype ...>\\", \\"min_rows\\": 5 (optional) }\\n# Output : { ok, message, count, totalWeight, holdings[], etf_estimated_change_pct, contributions[], meta{} }\\n\\nimport re, html as htmlmod\\nfrom typing import List, Dict, Optional\\n\\npayload = items[0].get(\\"json\\", {}) if items else {}\\ndoc: str = payload.get(\\"html\\", \\"\\") or \\"\\"\\nmin_rows: int = int(payload.get(\\"min_rows\\", 5))\\n\\n# ---------------------------\\n# Helpers\\n# ---------------------------\\ndef clean_text(s: str) -> str:\\n    \\"\\"\\"Remove comments/tags, unescape entities, squeeze spaces.\\"\\"\\"\\n    if s is None:\\n        return \\"\\"\\n    s = re.sub(r\\"<!--.*?-->\\", \\" \\", s, flags=re.S)\\n    s = re.sub(r\\"<script\\\\b[^>]*>.*?</script>\\", \\" \\", s, flags=re.S|re.I)\\n    s = re.sub(r\\"<style\\\\b[^>]*>.*?</style>\\", \\" \\", s, flags=re.S|re.I)\\n    s = re.sub(r\\"<[^>]+>\\", \\" \\", s)\\n    s = htmlmod.unescape(s)\\n    s = re.sub(r\\"\\\\s+\\", \\" \\", s).strip()\\n    return s\\n\\ndef num(s: str) -> Optional[float]:\\n    \\"\\"\\"Extract first signed float from string (commas allowed).\\"\\"\\"\\n    if not s:\\n        return None\\n    s2 = s.replace(\\",\\", \\"\\")\\n    m = re.search(r\\"(-?\\\\d+(?:\\\\.\\\\d+)?)\\", s2)\\n    return float(m.group(1)) if m else None\\n\\ndef find_holdings_table(html: str) -> str:\\n    \\"\\"\\"\\n    Try to extract the <tbody> containing the holdings rows.\\n    We focus on the 'dynamic-table' component Investing uses.\\n    \\"\\"\\"\\n    # 1) Prefer data-test=\\"dynamic-table\\"\\n    m = re.search(\\n        r'<div[^>]+data-test=[\\"\\\\']dynamic-table[\\"\\\\'][^>]*>.*?<tbody[^>]*>(.*?)</tbody>',\\n        html, flags=re.S|re.I\\n    )\\n    if m:\\n        return m.group(1)\\n    # 2) Fallback: any datatable-ish tbody near '% 鍮꾩쨷' header\\n    m = re.search(\\n        r'(<table[^>]*>.*?%?\\\\s*鍮꾩쨷.*?<tbody[^>]*>.*?</tbody>.*?</table>)',\\n        html, flags=re.S|re.I\\n    )\\n    if m:\\n        tb = re.search(r'<tbody[^>]*>(.*?)</tbody>', m.group(1), flags=re.S|re.I)\\n        if tb: return tb.group(1)\\n    # 3) Last resort: first tbody\\n    m = re.search(r'<tbody[^>]*>(.*?)</tbody>', html, flags=re.S|re.I)\\n    return m.group(1) if m else \\"\\"\\n\\ndef parse_headers(html: str) -> Dict[str,int]:\\n    \\"\\"\\"\\n    Parse header <th> texts and map to column indexes.\\n    Returns a dict like { 'name': 1, 'ticker': 2, 'weight': 3, 'price': 5, 'change': 6, 'shares': 7 }\\n    If fails, returns an empty dict (caller should use defaults).\\n    \\"\\"\\"\\n    # grab THEAD near dynamic-table\\n    thead = re.search(\\n        r'<div[^>]+data-test=[\\"\\\\']dynamic-table[\\"\\\\'][^>]*>.*?<thead[^>]*>(.*?)</thead>',\\n        doc, flags=re.S|re.I\\n    )\\n    if not thead:\\n        # second chance: any thead on page with 鍮꾩쨷 etc.\\n        thead = re.search(r'<thead[^>]*>(.*?)</thead>', doc, flags=re.S|re.I)\\n        if not thead:\\n            return {}\\n\\n    ths = re.findall(r'<th\\\\b[^>]*>(.*?)</th>', thead.group(1), flags=re.S|re.I)\\n    if not ths:\\n        return {}\\n    texts = [clean_text(th).lower() for th in ths]\\n\\n    idx_map = {}\\n    def find_one(keys: List[str]) -> Optional[int]:\\n        for i, t in enumerate(texts):\\n            if any(k in t for k in keys):\\n                return i\\n        return None\\n\\n    # Common Korean labels on page:\\n    # 醫낅ぉ紐? 湲고샇, % 鍮꾩쨷, 媛寃? 蹂??%, 二쇱떇 ??\n    idx_map['name']   = find_one(['醫낅ぉ紐?,'name'])\\n    idx_map['ticker'] = find_one(['湲고샇','symbol','?곗빱'])\\n    idx_map['weight'] = find_one(['% 鍮꾩쨷','鍮꾩쨷','weight'])\\n    idx_map['price']  = find_one(['媛寃?,'price'])\\n    idx_map['change'] = find_one(['蹂??%','蹂??','chg','change'])\\n    idx_map['shares'] = find_one(['二쇱떇 ??,'shares'])\\n\\n    # only keep non-None\\n    return {k:v for k,v in idx_map.items() if v is not None}\\n\\ndef parse_rows(tbody_html: str, idx: Dict[str,int]) -> List[Dict]:\\n    \\"\\"\\"\\n    Parse each <tr> and extract columns by detected index.\\n    If header index-map is missing, use Investing default positions.\\n    \\"\\"\\"\\n    # default positions for Investing holdings table (0 base in <td> list):\\n    # 0: checkbox, 1: name, 2: ticker, 3: weight, 4: ?곸듅?щ젰, 5: price, 6: change%, 7: shares\\n    default = {'name':1, 'ticker':2, 'weight':3, 'price':5, 'change':6, 'shares':7}\\n\\n    trs = re.findall(r'<tr\\\\b[^>]*>(.*?)</tr>', tbody_html, flags=re.S|re.I)\\n    out = []\\n    for i, tr in enumerate(trs, start=1):\\n        tds = re.findall(r'<td\\\\b[^>]*>(.*?)</td>', tr, flags=re.S|re.I)\\n        if not tds:\\n            continue\\n\\n        use = default.copy()\\n        if idx:  # shift to detected mapping if available\\n            # convert header <th>-index to <td>-index (both are 0-based in most tables)\\n            use.update(idx)\\n\\n        def col(which: str) -> Optional[str]:\\n            j = use.get(which, None)\\n            if j is None or j >= len(tds): return None\\n            return clean_text(tds[j])\\n\\n        name   = col('name')   or \\"\\"\\n        ticker = col('ticker') or \\"\\"\\n        weight_txt = col('weight') or \\"\\"\\n        price_txt  = col('price')  or \\"\\"\\n        chg_txt    = col('change') or \\"\\"\\n\\n        weight = num(weight_txt)   # % value (e.g., 11.69)\\n        price  = num(price_txt)\\n        chg    = num(chg_txt)\\n\\n        # fix sign for change (detect leading minus)\\n        if chg is not None and chg_txt.strip().startswith('-'):\\n            chg = -abs(chg)\\n\\n        # sanity: ensure we're not confusing price/change with Shares (big integers)\\n        # If 'change' ends up extremely large (like 676,004), treat as None.\\n        if chg is not None and abs(chg) > 200:   # % change shouldn't exceed 200 in normal day\\n            chg = None\\n        # Price should be non-crazy; if shows huge integer (shares), null it.\\n        if price is not None and price > 100000:\\n            price = None\\n\\n        if name and ticker and weight is not None:\\n            out.append({\\n                \\"rank\\": i,\\n                \\"name\\": name,\\n                \\"ticker\\": ticker,\\n                \\"weight\\": round(weight/100.0, 6),  # convert to fraction\\n                \\"price\\": price,\\n                \\"change_pct\\": chg\\n            })\\n    return out\\n\\ndef normalize_and_validate(holdings: List[Dict]) -> Dict:\\n    info = {}\\n    n = len(holdings)\\n    info[\\"count\\"] = n\\n    if n == 0:\\n        return {\\"holdings\\": [], \\"total\\": 0.0, \\"info\\": info}\\n\\n    total = sum(h[\\"weight\\"] for h in holdings if isinstance(h.get(\\"weight\\"), (int,float)))\\n    if total <= 0:\\n        total = 1.0\\n    # normalize to 1\\n    for h in holdings:\\n        if h.get(\\"weight\\") is not None:\\n            h[\\"weight\\"] = round(h[\\"weight\\"]/total, 6)\\n\\n    total_n = sum(h[\\"weight\\"] for h in holdings)\\n    info[\\"total_before_norm\\"] = total\\n    info[\\"total_after_norm\\"]  = round(total_n, 6)\\n\\n    # missing fields check\\n    miss_change = sum(1 for h in holdings if h.get(\\"change_pct\\") is None)\\n    info[\\"missing_change_pct\\"] = miss_change\\n    info[\\"missing_rate_change_pct\\"] = round(miss_change/max(n,1), 3)\\n\\n    return {\\"holdings\\": holdings, \\"total\\": round(total_n, 6), \\"info\\": info}\\n\\ndef calc_effect(holdings: List[Dict]) -> Dict:\\n    \\"\\"\\"\\n    ETF daily % change ~= sum_i (weight_i * change_pct_i)\\n    (weights are fractions that sum to 1)\\n    \\"\\"\\"\\n    contributions = []\\n    etf_pct = 0.0\\n    for h in holdings:\\n        w = h.get(\\"weight\\")\\n        c = h.get(\\"change_pct\\")\\n        if isinstance(w, (int,float)) and isinstance(c, (int,float)):\\n            contrib = w * c\\n            etf_pct += contrib\\n            contributions.append({\\n                \\"rank\\": h.get(\\"rank\\"),\\n                \\"ticker\\": h.get(\\"ticker\\"),\\n                \\"name\\": h.get(\\"name\\"),\\n                \\"weight\\": w,\\n                \\"change_pct\\": c,\\n                \\"contribution_pct_pt\\": round(contrib, 4)\\n            })\\n    contributions.sort(key=lambda x: (-abs(x[\\"contribution_pct_pt\\"]), x[\\"rank\\"]))\\n    return {\\n        \\"etf_estimated_change_pct\\": round(etf_pct, 4),\\n        \\"contributions\\": contributions\\n    }\\n\\n# ---------------------------\\n# Main\\n# ---------------------------\\nif not doc or len(doc) < 50:\\n    return [{\\n        \\"json\\": {\\n            \\"ok\\": False,\\n            \\"message\\": \\"html input is empty or too short\\",\\n            \\"meta\\": { \\"received_len\\": len(doc) }\\n        }\\n    }]\\n\\ntbody = find_holdings_table(doc)\\nrows_html = re.findall(r'<tr\\\\b[^>]*>.*?</tr>', tbody, flags=re.S|re.I)\\nrows_found = len(rows_html)\\n\\nif rows_found < min_rows:\\n    return [{\\n        \\"json\\": {\\n            \\"ok\\": False,\\n            \\"message\\": f\\"rows too few ({rows_found} < {min_rows})\\",\\n            \\"meta\\": { \\"rows_found\\": rows_found }\\n        }\\n    }]\\n\\n# header mapping (optional but safer)\\nidx_map = parse_headers(doc)\\n\\n# parse rows\\nholdings = parse_rows(tbody, idx_map)\\n\\n# validate/normalize\\nnv = normalize_and_validate(holdings)\\nholdings_n = nv[\\"holdings\\"]\\ntotal_w = nv[\\"total\\"]\\ninfo = nv[\\"info\\"]\\n\\nif len(holdings_n) < min_rows:\\n    return [{\\n        \\"json\\": {\\n            \\"ok\\": False,\\n            \\"message\\": f\\"parsed holdings too few ({len(holdings_n)} < {min_rows})\\",\\n            \\"meta\\": { \\"rows_found\\": rows_found, **info }\\n        }\\n    }]\\n\\n# calc etf change\\ncalc = calc_effect(holdings_n)\\n\\nout = {\\n    \\"ok\\": True,\\n    \\"message\\": \\"success\\",\\n    \\"count\\": len(holdings_n),\\n    \\"totalWeight\\": total_w,\\n    \\"holdings\\": holdings_n,\\n    \\"etf_estimated_change_pct\\": calc[\\"etf_estimated_change_pct\\"],\\n    \\"contributions\\": calc[\\"contributions\\"],\\n    \\"meta\\": {\\n        \\"rows_found\\": rows_found,\\n        \\"header_index_map\\": idx_map,\\n        **info\\n    }\\n}\\n\\nreturn 