Sub-workflow-ETF	f	[{"parameters":{"language":"python","pythonCode":"data = items[0].get(\\"json\\", {})\\nholdings = data.get(\\"holdings\\", [])\\n\\n# 誇(weight 횞 change_pct)\\netf_change_pct = sum(float(h.get(\\"weight\\", 0)) * float(h.get(\\"change_pct\\", 0)) for h in holdings)\\n\\ncontributions = []\\nfor h in holdings:\\n    weight = float(h.get(\\"weight\\", 0))\\n    chg = float(h.get(\\"change_pct\\", 0))\\n    contributions.append({\\n        \\"rank\\": h.get(\\"rank\\"),\\n        \\"ticker\\": h.get(\\"ticker\\"),\\n        \\"name\\": h.get(\\"name\\"),\\n        \\"weight\\": weight,\\n        \\"change_pct\\": chg,\\n        \\"contribution_pct_pt\\": round(weight * chg, 4),\\n    })\\n\\n# ????媛쒖쓽 ?꾩씠?쒕쭔 諛섑솚 (json ???꾨옒??aggregate + 諛곗뿴)\\nreturn [\\n    {\\n        \\"json\\": {\\n            \\"etf_estimated_change_pct\\": round(etf_change_pct, 4),\\n            \\"contributions\\": contributions\\n        }\\n    }\\n]\\n"},"type":"n8n-nodes-base.code","typeVersion":2,"position":[896,368],"id":"52928d46-8046-428a-829b-7021ad7f1fbe","name":"Code4"},{"parameters":{"language":"python","pythonCode":"# Input: items[0][\\"json\\"] == { \\"rows\\": [\\"<td>??/td>??\", ...] }\\nimport re, html\\n\\ndata = items[0].get(\\"json\\", {})\\nrow_htmls = data.get(\\"rows\\", [])\\n\\ndef clean(s: str) -> str:\\n    s = re.sub(r\\"<!--.*?-->\\", \\" \\", s, flags=re.S)\\n    s = re.sub(r\\"<[^>]+>\\", \\" \\", s)\\n    s = html.unescape(s)\\n    return re.sub(r\\"\\\\s+\\", \\" \\", s).strip()\\n\\ndef fnum(s: str):\\n    if s is None: return None\\n    m = re.search(r\\"-?\\\\d+(?:\\\\.\\\\d+)?\\", s.replace(\\",\\", \\"\\"))\\n    return float(m.group(0)) if m else None\\n\\nholdings = []\\n\\nfor i, tds_html in enumerate(row_htmls, start=1):\\n    # td 議곌컖??\n    tds_raw = re.findall(r\\"<td\\\\b[^>]*>(.*?)</td>\\", tds_html, flags=re.S|re.I)\\n    if len(tds_raw) < 5:\\n        continue\\n    tds = [clean(x) for x in tds_raw]\\n\\n    # 0:泥댄겕諛뺤뒪, 1:?대쫫, 2